// -------------------------------------------------------------------------------------------
var fps = function() {
    var fpstime = 0;
    var framecount = 0;

    return {
        value: 0,
        tick: function(dt) {
            if (fpstime > 0.25) {
                // Calculate fps
                this.value = Math.round(framecount / fpstime);
                // Reset time and framecount
                fpstime = 0;
                framecount = 0;
            }
            
            // Increase time and framecount
            fpstime += dt;
            framecount++;
        }
    };
}();

// -------------------------------------------------------------------------------------------
const gamestates = { init: 0, ready: 1, resolve: 2, gameover: 3 };
const newGame = function(canvas) {
        // Level object
        var level = {
            header: 66,     // size of the header
            columns: 5,     // Number of tile columns
            rows: 7,        // Number of tile rows
            gap: 4,         // space between tiles
            tiles: [],      // The two-dimensional tile array
        };
    
        const side = Math.floor(Math.min(canvas.width, canvas.height - level.header) * 0.9);
        level.tilewidth = Math.floor(side/level.columns);
        level.x = Math.floor((canvas.width - level.tilewidth * level.columns)/2.0);
    
        level.tileheight = level.tilewidth;
        level.y = Math.floor(level.header + (canvas.height - level.header - level.tileheight * level.rows)/2.0);

    // Initialize the two-dimensional tile array
    for (var i=0; i<level.columns; i++) {
        level.tiles[i] = [];
        for (var j=0; j<level.rows; j++) {
            // Define a tile type and a shift parameter for animation
            level.tiles[i][j] = { type: 0, shift:0 }
        }
    }

    return {
        activeTile: null,
        level: level,
        score: 0,
        state: gamestates.init,
        clusters: [],  // { column, row, length, horizontal }
        moves: [], // { column1, row1, column2, row2 }
        currentmove: { column1: 0, row1: 0, column2: 0, row2: 0 },
        animationstate: 0,
        animationtime: 0,
        animationtimetotal: 0.3,
        tilecolors: [
            loadImg("data:image/png;base64,"),
            loadImg("data:image/png;base64,"),
            loadImg("data:image/png;base64,"),
            loadImg("data:image/png;base64,"),
            loadImg("data:image/png;base64,"),
            loadImg("data:image/png;base64,"),
            loadImg("data:image/png;base64,")
        ],
    }
}

