var newRenderer = function(context, canvas, game) {

    // Draw text that is centered
    function drawCenterText(text, x, y, width) {
        var metrics = context.measureText(text);
        let actualHeight = metrics.actualBoundingBoxAscent + metrics.actualBoundingBoxDescent;
        context.fillText(text, x - metrics.width/2, y + actualHeight/2.0);
    };

    function getTileCoordinate(column, row, columnoffset, rowoffset) {
        var tilex = game.level.x + (column + columnoffset) * game.level.tilewidth;
        var tiley = game.level.y + (row + rowoffset) * game.level.tileheight;
        return { tilex: tilex, tiley: tiley};
    }

    // Draw a tile with a color
    function drawTile(x, y, index, active) {
        var gap = game.level.gap;
        if (active == true) {
            gap = Math.min(game.level.tilewidth, game.level.tileheight)/4;
        }

        if (index == -2) {
            context.fillStyle = "rgb(0, 0, 0)";
            context.fillRect(x + gap/2, y + gap/2, game.level.tilewidth - gap, game.level.tileheight - gap);
            // context.clearRect(x + gap/2, y + gap/2, level.tilewidth - gap, level.tileheight - gap);
        } else if (index >= 0 && index < game.tilecolors.length) {
            context.drawImage(game.tilecolors[index], x + gap/2, y + gap/2, game.level.tilewidth - gap, game.level.tileheight - gap);
        }
    }

    function renderTiles() {
        for (var i=0; i<game.level.columns; i++) {
            for (var j=0; j<game.level.rows; j++) {
                // Get the shift of the tile for animation
                var shift = game.level.tiles[i][j].shift;
                if (game.state == gamestates.resolve && 
                    (game.animationstate == 2 || game.animationstate == 3) && 
                    (game.currentmove.column1 == i && game.currentmove.row1 == j || game.currentmove.column2 == i && game.currentmove.row2 == j)) {
                    // skip tiles which in animation state
                } else {
                    // Calculate the tile coordinates
                    var coord = getTileCoordinate(i, j, 0, (game.animationtime / game.animationtimetotal) * shift);                
                    drawTile(coord.tilex, coord.tiley, game.level.tiles[i][j].type, game.activeTile != null && game.activeTile.column == i && game.activeTile.row == j ? true : false);
                }
            }
        }
        
        // Render the swap animation
        if (game.state == gamestates.resolve && (game.animationstate == 2 || game.animationstate == 3)) {
            // Calculate the x and y shift
            var shiftx = game.currentmove.column2 - game.currentmove.column1;
            var shifty = game.currentmove.row2 - game.currentmove.row1;

            // First tile
            var coord1shift = getTileCoordinate(game.currentmove.column1, game.currentmove.row1, (game.animationtime / game.animationtimetotal) * shiftx, (game.animationtime / game.animationtimetotal) * shifty);
            var col1 = game.level.tiles[game.currentmove.column1][game.currentmove.row1].type;
            
            // Second tile
            var coord2shift = getTileCoordinate(game.currentmove.column2, game.currentmove.row2, (game.animationtime / game.animationtimetotal) * -shiftx, (game.animationtime / game.animationtimetotal) * -shifty);
            var col2 = game.level.tiles[game.currentmove.column2][game.currentmove.row2].type;
            
            // Change the order, depending on the animation state
            if (game.animationstate == 2) {
                drawTile(coord1shift.tilex, coord1shift.tiley, col1);
                drawTile(coord2shift.tilex, coord2shift.tiley, col2);
            } else {
                drawTile(coord2shift.tilex, coord2shift.tiley, col2);
                drawTile(coord1shift.tilex, coord1shift.tiley, col1);
            }
        }
    }

    function renderClusters() {
        for (var i=0; i<game.clusters.length; i++) {
            // Calculate the tile coordinates
            var coord = getTileCoordinate(game.clusters[i].column, game.clusters[i].row, 0, 0);
            context.fillStyle = "rgba(255, 0, 0, 0.8)";
            context.fillRect(coord.tilex, coord.tiley , game.level.tilewidth * (game.clusters[i].horizontal ? game.clusters[i].length : 1), game.level.tileheight * (game.clusters[i].horizontal ? 1 : game.clusters[i].length));
        }
    }

    function renderRoundCorner(x, y, w, h, r, color) {
        context.fillStyle = color;
        context.beginPath();
        context.moveTo(x + w, y + h);
        context.arcTo(x + 0, y+h, x + 0, y+0,r);
        context.arcTo(x + 0, y+0, x + w, y+0,r);
        context.arcTo(x+w, y+0, x+w, y+100,r);
        context.arcTo(x+w, y+h, x+0, y+h, r);
        context.fill();
    }

    const bg = new Image();
    bg.src = 'bg.svg';

    return {
        render: function() {
            // Draw the frame
            // Draw background and a border
            context.fillStyle = "#E9DDC0";
            context.fillRect(0, 0, canvas.width, canvas.height);

            // TODO: replace
            // // Draw header
            // context.fillStyle = "#303030";
            // context.fillRect(0, 0, canvas.width, game.level.header);
                
            // // Display fps
            // context.fillStyle = "#ffffff";
            // context.font = "12px Verdana";
            // context.fillText("Fps: " + fps.value, 13, 50);
            
            // // Draw score
            // context.fillStyle = "#FFFFFF";
            // context.font = "24px Verdana";
            // drawCenterText("Score: "+game.score, canvas.width/2.0, 33, 150);

            if (bg.width != 0 && bg.height != 0) {
                const sx = canvas.width/bg.width;
                const sy = canvas.height/bg.height;
                const scale = Math.max(sx, sy);
                context.drawImage(bg, (canvas.width - bg.width*scale)/2.0, (canvas.height - bg.height*scale)/2.0, bg.width*scale, bg.height*scale);
            }

            // Draw level background
            var levelwidth = game.level.columns * game.level.tilewidth;
            var levelheight = game.level.rows * game.level.tileheight;
            renderRoundCorner(game.level.x-20, game.level.y-20, levelwidth + 40, levelheight + 40, 20/420 * levelwidth, "#DAC49A");

            for (var i=0; i<game.level.columns; i++) {
                for (var j=0; j<game.level.rows; j++) {
                    var coord = getTileCoordinate(i, j, 0, 0);
                    renderRoundCorner(coord.tilex+4, coord.tiley+4, game.level.tilewidth-8, game.level.tileheight-8, 11/64*game.level.tilewidth, "rgba(199, 176, 128, 1)");
                }
            }
            
            // Render tiles
            renderTiles();
            
            // Render clusters
            renderClusters();
            
            // Game Over overlay
            if (game.state == gamestates.gameover) {
                context.fillStyle = "rgba(0, 0, 0, 0.8)";
                context.fillRect(game.level.x, game.level.y, levelwidth, levelheight);
                
                context.fillStyle = "#ffffff";
                context.font = "24px Verdana";
                drawCenterText("Game Over!", game.level.x + levelwidth/2.0, game.level.y + levelheight / 2, levelwidth);
            }
        },
    
    }
}

