var looper = function() {
    var _tick = null;

    function _loop(dt) {
        window.requestAnimationFrame(_loop);
        if (_tick != null) {
            _tick(dt);
        }
    }

    return {
        start: function(tick) {
            if (typeof tick === "function") {
                _tick = tick;
            }
            _loop(0);
        }

    };
}()

var newTile = function(column, row) {
    return {column: column, row: row};
}

const loadImg = function(name) {
    const gem1 = new Image();
    gem1.src = name;
    return gem1;
}

// The function gets called when the window is fully loaded
window.onload = function() {
    // Get the canvas and context
    const ratio = Math.ceil(window.devicePixelRatio);
    var canvas = document.getElementById("viewport");
    canvas.width = window.innerWidth * ratio;
    canvas.height = window.innerHeight * ratio;
    canvas.style.width = `${window.innerWidth}px`;
    canvas.style.height = `${window.innerHeight}px`;

    var context = canvas.getContext("2d");
    
    // Timing and frames per second
    var lastframe = 0;
    
    // Mouse dragging
    var drag = false;

    var game = newGame(canvas);
    
    // Add mouse events
    canvas.addEventListener("touchmove", onMouseMove);
    canvas.addEventListener("touchstart", onMouseDown);
    canvas.addEventListener("touchend", onMouseUp);
    canvas.addEventListener("touchcancel", onMouseOut);

    var renderer = newRenderer(context, canvas, game);
        
    // Update the game state
    function update(tframe) {
        var dt = (tframe - lastframe) / 1000;
        lastframe = tframe;
        
        fps.tick(dt);

        if (game.state == gamestates.ready) {
            // Game is ready for player input. Do nothing.
            
            // Check for game over
            if (game.moves.length <= 0) {
                game.state = gamestates.gameover
            }
        } else if (game.state == gamestates.resolve) {
            // Game is busy resolving and animating clusters
            game.animationtime += dt;
            
            if (game.animationstate == 0) {
                // Clusters need to be found and removed
                if (game.animationtime > game.animationtimetotal) {
                    // Find clusters
                    findClusters();
                    
                    if (game.clusters.length > 0) {
                        // Add points to the score
                        for (var i=0; i<game.clusters.length; i++) {
                            // Add extra points for longer clusters
                            game.score += 100 * (game.clusters[i].length - 2);
                        }
                    
                        // Clusters found, remove them
                        removeClusters();
                        
                        // Tiles need to be shifted
                        game.animationstate = 1;
                    } else {
                        // No clusters found, animation complete
                        game.state = gamestates.ready;
                    }
                    game.animationtime = 0;
                }
            } else if (game.animationstate == 1) {
                // Tiles need to be shifted
                if (game.animationtime > game.animationtimetotal) {
                    // Shift tiles
                    shiftTiles();
                    
                    // New clusters need to be found
                    game.animationstate = 0;
                    game.animationtime = 0;
                    
                    // Check if there are new clusters
                    findClusters();
                    if (game.clusters.length <= 0) {
                        // Animation complete
                        game.state = gamestates.ready;
                    }
                }
            } else if (game.animationstate == 2) {
                // Swapping tiles animation
                if (game.animationtime > game.animationtimetotal) {
                    // Swap the tiles
                    swap(game.currentmove.column1, game.currentmove.row1, game.currentmove.column2, game.currentmove.row2);
                    
                    // Check if the swap made a cluster
                    findClusters();
                    if (game.clusters.length > 0) {
                        // Valid swap, found one or more clusters
                        // Prepare animation states
                        game.animationstate = 0;
                        game.animationtime = 0;
                        game.state = gamestates.resolve;
                    } else {
                        // Invalid swap, Rewind swapping animation
                        game.animationstate = 3;
                        game.animationtime = 0;
                    }
                    
                    // Update moves and clusters
                    findMoves();
                    findClusters();
                }
            } else if (game.animationstate == 3) {
                // Rewind swapping animation
                if (game.animationtime > game.animationtimetotal) {
                    // Invalid swap, swap back
                    swap(game.currentmove.column1, game.currentmove.row1, game.currentmove.column2, game.currentmove.row2);
                    
                    // Animation complete
                    game.state = gamestates.ready;
                }
            }
            
            // Update moves and clusters
            findMoves();
            findClusters();
        }
    }

    // Start a new game
    function restartGame() {
        game.score = 0;
        // // Reset score
        // score = 0;
        
        // Set the gamestate to ready
        game.state = gamestates.ready;
        
        // Create the level
        createLevel();
        
        // Find initial clusters and moves
        findMoves();
        findClusters(); 
    }
    
    // Create a random level
    function createLevel() {
        var done = false;
        
        // Keep generating levels until it is correct
        while (!done) {
        
            // Create a level with random tiles
            for (var i=0; i<game.level.columns; i++) {
                for (var j=0; j<game.level.rows; j++) {
                    game.level.tiles[i][j].type = getRandomTile();
                }
            }
            
            // Resolve the clusters
            resolveClusters();
            
            // Check if there are valid moves
            findMoves();
            
            // Done when there is a valid move
            if (game.moves.length > 0) {
                done = true;
            }
        }
    }
    
    // Get a random tile
    function getRandomTile() {
        return Math.floor(Math.random() * game.tilecolors.length);
    }
    
    // Remove clusters and insert tiles
    function resolveClusters() {
        // Check for clusters
        findClusters();
        
        // While there are clusters left
        while (game.clusters.length > 0) {
        
            // Remove clusters
            removeClusters();
            
            // Shift tiles
            shiftTiles();
            
            // Check if there are clusters left
            findClusters();
        }
    }
    
    // Find clusters in the level
    function findClusters() {
        // Reset clusters
        game.clusters = []
        
        // Find horizontal clusters
        for (var j=0; j<game.level.rows; j++) {
            // Start with a single tile, cluster of 1
            var matchlength = 1;
            for (var i=0; i<game.level.columns; i++) {
                var checkcluster = false;
                
                if (i == game.level.columns-1) {
                    // Last tile
                    checkcluster = true;
                } else {
                    // Check the type of the next tile
                    if (game.level.tiles[i][j].type == game.level.tiles[i+1][j].type &&
                        game.level.tiles[i][j].type != -1) {
                        // Same type as the previous tile, increase matchlength
                        matchlength += 1;
                    } else {
                        // Different type
                        checkcluster = true;
                    }
                }
                
                // Check if there was a cluster
                if (checkcluster) {
                    if (matchlength >= 3) {
                        // Found a horizontal cluster
                        game.clusters.push({ column: i+1-matchlength, row:j,
                                        length: matchlength, horizontal: true });
                    }
                    
                    matchlength = 1;
                }
            }
        }

        // Find vertical clusters
        for (var i=0; i<game.level.columns; i++) {
            // Start with a single tile, cluster of 1
            var matchlength = 1;
            for (var j=0; j<game.level.rows; j++) {
                var checkcluster = false;
                
                if (j == game.level.rows-1) {
                    // Last tile
                    checkcluster = true;
                } else {
                    // Check the type of the next tile
                    if (game.level.tiles[i][j].type == game.level.tiles[i][j+1].type &&
                        game.level.tiles[i][j].type != -1) {
                        // Same type as the previous tile, increase matchlength
                        matchlength += 1;
                    } else {
                        // Different type
                        checkcluster = true;
                    }
                }
                
                // Check if there was a cluster
                if (checkcluster) {
                    if (matchlength >= 3) {
                        // Found a vertical cluster
                        game.clusters.push({ column: i, row:j+1-matchlength,
                                        length: matchlength, horizontal: false });
                    }
                    
                    matchlength = 1;
                }
            }
        }
    }
    
    // Find available moves
    function findMoves() {
        // Reset moves
        game.moves = []
        
        // Check horizontal swaps
        for (var j=0; j<game.level.rows; j++) {
            for (var i=0; i<game.level.columns-1; i++) {
                // Swap, find clusters and swap back
                swap(i, j, i+1, j);
                findClusters();
                swap(i, j, i+1, j);
                
                // Check if the swap made a cluster
                if (game.clusters.length > 0) {
                    // Found a move
                    game.moves.push({column1: i, row1: j, column2: i+1, row2: j});
                }
            }
        }
        
        // Check vertical swaps
        for (var i=0; i<game.level.columns; i++) {
            for (var j=0; j<game.level.rows-1; j++) {
                // Swap, find clusters and swap back
                swap(i, j, i, j+1);
                findClusters();
                swap(i, j, i, j+1);
                
                // Check if the swap made a cluster
                if (game.clusters.length > 0) {
                    // Found a move
                    game.moves.push({column1: i, row1: j, column2: i, row2: j+1});
                }
            }
        }
        
        // Reset clusters
        game.clusters = []
    }
    
    // Loop over the cluster tiles and execute a function
    function loopClusters(func) {
        for (var i=0; i<game.clusters.length; i++) {
            //  { column, row, length, horizontal }
            var cluster = game.clusters[i];
            var coffset = 0;
            var roffset = 0;
            for (var j=0; j<cluster.length; j++) {
                func(i, cluster.column+coffset, cluster.row+roffset, cluster);
                
                if (cluster.horizontal) {
                    coffset++;
                } else {
                    roffset++;
                }
            }
        }
    }
    
    // Remove the clusters
    function removeClusters() {
        // Change the type of the tiles to -1, indicating a removed tile
        loopClusters(function(index, column, row, cluster) { game.level.tiles[column][row].type = -1; });

        // Calculate how much a tile should be shifted downwards
        for (var i=0; i<game.level.columns; i++) {
            var shift = 0;
            for (var j=game.level.rows-1; j>=0; j--) {
                // Loop from bottom to top
                if (game.level.tiles[i][j].type == -1) {
                    // Tile is removed, increase shift
                    shift++;
                    game.level.tiles[i][j].shift = 0;
                } else {
                    // Set the shift
                    game.level.tiles[i][j].shift = shift;
                }
            }
        }
    }
    
    // Shift tiles and insert new tiles
    function shiftTiles() {
        // Shift tiles
        for (var i=0; i<game.level.columns; i++) {
            for (var j=game.level.rows-1; j>=0; j--) {
                // Loop from bottom to top
                if (game.level.tiles[i][j].type == -1) {
                    // Insert new random tile
                    game.level.tiles[i][j].type = getRandomTile();
                } else {
                    // Swap tile to shift it
                    var shift = game.level.tiles[i][j].shift;
                    if (shift > 0) {
                        swap(i, j, i, j+shift)
                    }
                }
                
                // Reset shift
                game.level.tiles[i][j].shift = 0;
            }
        }
    }
    
    // Get the tile under the mouse
    function getMouseTile(pos) {
        var tx = Math.floor((pos.x - game.level.x) / game.level.tilewidth);
        var ty = Math.floor((pos.y - game.level.y) / game.level.tileheight);
        if (tx >= 0 && tx < game.level.columns && ty >= 0 && ty < game.level.rows) {
            return {
                valid: true,
                x: tx,
                y: ty
            };
        }
        return null;
    }
    
    // Check if two tiles can be swapped
    function canSwap(x1, y1, x2, y2) {
        // Check if the tile is a direct neighbor of the selected tile
        if ((Math.abs(x1 - x2) == 1 && y1 == y2) ||
            (Math.abs(y1 - y2) == 1 && x1 == x2)) {
            return true;
        }
        
        return false;
    }
    
    // Swap two tiles in the level
    function swap(x1, y1, x2, y2) {
        var typeswap = game.level.tiles[x1][y1].type;
        game.level.tiles[x1][y1].type = game.level.tiles[x2][y2].type;
        game.level.tiles[x2][y2].type = typeswap;
    }
    
    // Swap two tiles as a player action
    function mouseSwap(c1, r1, c2, r2) {
        // Save the current move
        game.currentmove = {column1: c1, row1: r1, column2: c2, row2: r2};
    
        // Deselect
        game.activeTile = null;
        
        // Start animation
        game.animationstate = 2;
        game.animationtime = 0;
        game.state = gamestates.resolve;
    }
    
    // On mouse movement
    function onMouseMove(e) {
        e.preventDefault();
        // Get the mouse position
        var pos = getMousePos(canvas, e);
        
        // Check if we are dragging with a tile selected
        if (drag && game.activeTile != null) {
            // Get the tile under the mouse
            mt = getMouseTile(pos);
            if (mt != null) {
                // Valid tile
                
                // Check if the tiles can be swapped
                if (canSwap(mt.x, mt.y, game.activeTile.column, game.activeTile.row)){
                    // Swap the tiles
                    mouseSwap(mt.x, mt.y, game.activeTile.column, game.activeTile.row);
                }
            }
        }
    }
    
    // On mouse button click
    function onMouseDown(e) {
        e.preventDefault();
        // Get the mouse position
        var pos = getMousePos(canvas, e);
        
        // Start dragging
        if (!drag) {
            mt = getMouseTile(pos);
            
            if (mt != null) {
                // Valid tile
                var swapped = false;
                if (game.activeTile != null) {
                    if (mt.x == game.activeTile.column && mt.y == game.activeTile.row) {
                        // Same tile selected, deselect
                        game.activeTile = null;
                        drag = true;
                        return;
                    } else if (canSwap(mt.x, mt.y, game.activeTile.column, game.activeTile.row)){
                        // Tiles can be swapped, swap the tiles
                        mouseSwap(mt.x, mt.y, game.activeTile.column, game.activeTile.row);
                        swapped = true;
                    }
                }
                
                if (!swapped) {
                    // Set the new selected tile
                    game.activeTile = newTile(mt.x, mt.y);
                }
            } else {
                // Invalid tile
                game.activeTile = null;
            }

            // Start dragging
            drag = true;
        }
    }
    
    function onMouseUp(e) {
        e.preventDefault();
        if (game.state === gamestates.gameover) {
            return;
        }
        // Reset dragging
        drag = false;
    }
    
    function onMouseOut(e) {
        e.preventDefault();
        if (game.state === gamestates.gameover) {
            return;
        }
        // Reset dragging
        drag = false;
    }
    
    // Get the mouse position
    function getMousePos(canvas, e) {
        var rect = canvas.getBoundingClientRect();
        const touch = e.touches[0];
        return {
            x: Math.round(((touch.clientX - rect.left) / (rect.right - rect.left)) * canvas.width),
            y: Math.round(((touch.clientY - rect.top) / (rect.bottom - rect.top)) * canvas.height),
        };
    }
    
    // New game
    restartGame();    
    // Enter main loop
    looper.start(function(tframe) {
        update(tframe);
        renderer.render();
    });
};